import React from 'react';
import TodoListItem from './TodoListItem.js';

const TodoList = () =>
{
	const items = ['Дело 1', 'Дело 2', 'Дело 3'];
	return(
		<ul>
			<li><TodoListItem label="Дело 1" important={false}/></li>
			<li><TodoListItem label="Дело 2" important/></li>
		</ul>
	);
};

export default TodoList;
